import React from "react";

import styles from "./BodyCity.module.css";

const BodyCity = (props) => {
  return (
    <div>
      <img src={props.image} className={styles.img}></img>
      <div>
        <h2>{props.subText}</h2>
      </div>
    </div>
  );
};

export default BodyCity;
